    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE - col2 NOT BETWEEN - ( + 64 ) + - 21 + 98 AND - + col2 - - - col1;
  - name: tab1

outputs:
  - name: q3656.out
    data: |
      51	14	96
      85	5	59
      91	47	68
